import "../App.css";

import React from 'react';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';

import Container from 'react-bootstrap/Container';
import rNavbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

const Navbar = () => {
    return (
    <Router>
        <Container className = "p-4" fluid = {true} style={{display:'flex', justifyContent:'flex-end'}}>
        <rNavbar expand="md" bg="transparent">

            <rNavbar.Toggle className="border-0" aria-controls="navbar-toggle"/>
            <rNavbar.Collapse id="navbar-toggle">
            <Nav className="ml-auto">
                <Link className="nav-link nav-custom" to="/design-work">Work</Link>
                <Link className="nav-link nav-custom" to="/about">About</Link>
                <Link className="nav-link nav-custom" to="/resume">Resume</Link>
            </Nav>
            </rNavbar.Collapse>
        </rNavbar>
        </Container>
    </Router>
    );
}

export default Navbar;
